import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-green-500 p-4 text-white">
      <Link to="/" className="mr-4">Index</Link>
      <Link to="/farm-sales">Farm Sales</Link>
    </nav>
  );
};

export default Navbar;
